import React from 'react';
import style from "./NavBar.module.css";
import logo from "../../img/logo.png";

function NavBar(){
    return (
        <div className={style.container}>
        <div className={style.logo}>
            <img src={logo} alt="logo" />
        </div>
        <div>
           <ul>
                <li>Home</li>
                <li>Nueva Receta</li>
                <li>Proyecto</li>
           </ul>
        </div>
        </div>
    )
}


export default NavBar;
